import React from 'react';
import './NewPost.scss';
import {TextField, Button, Typograpghy, Typography} from '@material-ui/core';
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles ({
  disabledButton: {
    color: '#000020'
  },
  enabledButton: {
    color: '#000000'
  }
})

const NewPost = () => {
  const classes = useStyles();

  return (
    <div className="NewPostModal">
      <Typography>BACK</Typography>
      <img src="https://i.imgur.com/9wF1kZd.jpeg" class="UploadedImg"></img>
      <div class="FieldWrapper"><TextField
      label="Your Name">
      </TextField></div>
      <div class="FieldWrapper"><TextField
      label="Share more about this memory with Terrence">
      </TextField></div>
      <div class="ButtonWrapper"><Button
      color="primary">
        SHARE
      </Button></div>
    </div> 
  )
}

export default NewPost;
